import React from "react";
import About_Icon from "../assets/about-resume.png";
import Education_Icon from "..assets/education-resume.png";
import Experinece_Icon from "..assets/experience-resume.png";
import Project_Icon from "..assets/project-resume.pmg";

const SideNavbar = ({ setInputType }) => {
  return (
    <div className="flex flex-col gap-16 p-2 border-2 border-[red]">
      <div
        className="cursor-pointer p-3 text-center bg-[#f8a100] rounded-md"
        onClick={() => setInputType("about")}
      >
        <img src={About_Icon} alt="about" />
        About
      </div>
      <div
        className="cursor-pointer p-3 text-center bg-[#f8a100] rounded-md"
        onClick={() => setInputType("education")}
      >
        <img src={Education_Icon} alt="resume" />
        Education
      </div>
      <div
        className="cursor-pointer p-3 text-center bg-[#f8a100] rounded-md"
        onClick={() => setInputType("experience")}
      >
        <img src={Education_Icon} alt="resume" />
        Experience
      </div>
      <div
        className="cursor-pointer p-3 text-center bg-[#f8a100] rounded-md"
        onClick={() => setInputType("projects")}
      >
        Projects
      </div>
    </div>
  );
};

export default SideNavbar;
